import React from "react";


const LandingPage = () => {
  return (
    <div className="landing-page">
      <h1>Bienvenido a Construcciones XYZ</h1>
      <p>
        En Construcciones XYZ, nos dedicamos a hacer realidad tus sueños. Con más de 20 años de experiencia, 
        somos líderes en la industria de la construcción, ofreciendo servicios de alta calidad y un compromiso 
        inquebrantable con la satisfacción del cliente.
      </p>
      <img src={constructionImage} alt="Construction" />
      <p>
        Nuestro equipo de profesionales está aquí para ayudarte en cada paso del camino. Ya sea que estés 
        construyendo una nueva casa, renovando tu oficina o desarrollando un proyecto comercial, estamos 
        aquí para convertir tus ideas en realidad.
      </p>
    </div>
  );
};

export default LandingPage;
